column8:
リュックの底にかたまって目的のものが探せなくてイライラ・・・という事も防げます。傾きやすいドリンクや傘なども入れるポケットあり。各種ポケットに小物が分けて入れられてとても便利です。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">リュックの底にかたまって目的のものが探せなくてイライラ・・・という事も防げます。傾きやすいドリンクや傘なども入れるポケットあり。各種ポケットに小物が分けて入れられてとても便利です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">(約)W10×D25.5×H36cm</font><br><font color="#333333" size="-1">個装サイズ：38×27×3cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：220g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">生地:ポリエステル<br>中材:PE材・ウレタンフォーム<br>裏地・バイアス:ポリエステル</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">縦約38cm、横約30cm、マチ幅約12cm以上のリュックに対応<br>持ち手:全長20cm<br>ペットボトルホルダー:直径7cm、高さ13cm<br>ポケット数:8個</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
